import '../App.css';
import {Link} from "react-router-dom";

function Nav() {
    return (
        <div>
            <nav>
                <Link to="/">
                    <h3>Home</h3>
                </Link>
                <ul className="nav-links">
                    <li>
                        <Link to="/muscle"><li>muscle</li></Link>
                        <Link to="/exercise"><li>exercise</li></Link>
                    </li>
                </ul>
            </nav>
        </div>
    );
}

export default Nav;
